import React from 'react';
import { Form, Button, ButtonGroup } from 'react-bootstrap';


function Searchbar(props) {

    return (



                <Form action="http://google.com/search" method="get">
                    <Form.Group>
                        <Form.Control type='text' placeholder='Search books' {...props}/>
                        <ButtonGroup>
                            <Button {...props} type="submit" class="btn btn-default">Author Search</Button>
                            <Button {...props} type="submit" class="btn btn-default">Title Search</Button>
                        </ButtonGroup>
                    </Form.Group>
                </Form>

    );

}

export default Searchbar;
